import React from 'react';
import './WhyChooseUs.css';
import Img5 from './Pictures/Picture9.jpg';
import Img6 from './Pictures/Picture13.jpg';
import Img7 from './Pictures/Picture22.jpg';
import Img8 from './Pictures/Picture40.jpg';
const WhyChooseUs = () => {
    return (
        <section className="home__section home__section--why-choose">
            <h2>Why Choose Brick Tech Contracting Corp?</h2>
            <h3>Experienced and Skilled Team</h3>
            <div className="home__why-choose-content">
                <div className="home__why-choose-text">
                    <p>Our construction company NYC team consists of highly skilled and experienced professionals who are dedicated to providing superior craftsmanship and unparalleled customer service. With a keen eye for detail, we ensure that every project is completed to the highest standards.</p>
                    <button>Contact Us</button>
                </div>
                <div className="home__why-choose-images">
                    <img src={Img5} alt="Why Choose 1" className="image__item"/>
                    <img src={Img6} alt="Why Choose 2" className="image__item"/>
                    <img src={Img7} alt="Why Choose 3" className="image__item"/>
                    <img src={Img8} alt="Why Choose 4" className="image__item"/>
                </div>
            </div>
        </section>
    );
};

export default WhyChooseUs;
